// src/pages/ExercisePage.js
import React, { useEffect, useRef, useState } from 'react';
import { useParams } from 'react-router-dom';
import * as tf from '@tensorflow/tfjs';
import * as posedetection from '@tensorflow-models/pose-detection';
import '@tensorflow/tfjs-backend-webgl';
import './ExercisePage.css';

import { processChairSquat, resetChairSquat } from '../exercises/ChairSquats';

const exerciseData = {
  cardio: ['Chair Marching', 'Leg Extensions', 'Step-Ups'],
  neuro: ['Balance Training', 'Gait Training', 'Coordination'],
  ortho: ['Chair Squats', 'Leg Raise', 'Shoulder Rolls'],
  physio: ['Arm Circles', 'Shoulder Rolls', 'Hydration Tips'],
};

const exerciseValidators = {
  'Chair Squats': processChairSquat,
};

function ExercisePage() {
  const { type } = useParams();
  const [selectedExercise, setSelectedExercise] = useState('');
  const [isScanning, setIsScanning] = useState(false);
  const [repCount, setRepCount] = useState(0);
  const [feedback, setFeedback] = useState('');
  const [timer, setTimer] = useState(0);

  const videoRef = useRef(null);
  const canvasRef = useRef(null);
  const detectorRef = useRef(null);
  const intervalRef = useRef(null);
  const animationRef = useRef(null);

  const exercises = exerciseData[type] || [];

  useEffect(() => {
    let timerId;

    if (isScanning) {
      timerId = setInterval(() => {
        setTimer(prev => prev + 1);
      }, 1000);
    } else {
      clearInterval(timerId);
    }

    return () => clearInterval(timerId);
  }, [isScanning]);

  const startCamera = async () => {
    await tf.setBackend('webgl');
    detectorRef.current = await posedetection.createDetector(posedetection.SupportedModels.MoveNet, {
      modelType: posedetection.movenet.modelType.SINGLEPOSE_LIGHTNING,
    });

    const stream = await navigator.mediaDevices.getUserMedia({ video: true });
    videoRef.current.srcObject = stream;
    await videoRef.current.play();

    detectPose();
  };

  const detectPose = async () => {
    if (!detectorRef.current || !videoRef.current) return;

    const poses = await detectorRef.current.estimatePoses(videoRef.current);
    const ctx = canvasRef.current.getContext('2d');
    ctx.clearRect(0, 0, canvasRef.current.width, canvasRef.current.height);

    poses.forEach(pose => {
      pose.keypoints.forEach(keypoint => {
        if (keypoint.score > 0.5) {
          ctx.beginPath();
          ctx.arc(keypoint.x, keypoint.y, 5, 0, 2 * Math.PI);
          ctx.fillStyle = 'lime';
          ctx.fill();
        }
      });

      if (selectedExercise in exerciseValidators) {
        const result = exerciseValidators[selectedExercise](pose.keypoints);
        setFeedback(result.feedback);
        setRepCount(result.repCount);
      }
    });

    animationRef.current = requestAnimationFrame(detectPose);
  };

  const handleStart = async () => {
    if (!selectedExercise) return alert('Please select an exercise first!');
    resetChairSquat();
    setFeedback('');
    setRepCount(0);
    setTimer(0);
    setIsScanning(true);
    await startCamera();
  };

  const handleStop = () => {
    setIsScanning(false);
    cancelAnimationFrame(animationRef.current);
    if (videoRef.current?.srcObject) {
      videoRef.current.srcObject.getTracks().forEach(track => track.stop());
    }
    setFeedback('');
    setTimer(0);
  };

  const handleSave = () => {
    alert(`Saved ${repCount} reps of ${selectedExercise}`);
  };

  return (
    <div className="exercise-container">
      <header className="top-bar">AI-Rehab – {selectedExercise || 'Select Exercise'}</header>

      <div className="main-layout">
        <aside className="left-panel">
          {exercises.map(ex => (
            <button
              key={ex}
              className={`exercise-button ${selectedExercise === ex ? 'active' : ''}`}
              onClick={() => setSelectedExercise(ex)}
            >
              {ex}
            </button>
          ))}
        </aside>

        <main className="content-panel">
          <div className="video-area">
            <video ref={videoRef} width="640" height="480" style={{ display: 'block' }} />
            <canvas
              ref={canvasRef}
              width="640"
              height="480"
              style={{ position: 'absolute', top: 0, left: 0 }}
            />
          </div>

          <div className="controls">
            <button onClick={handleStart}>Start</button>
            <button onClick={handleStop}>Stop</button>
            <button onClick={handleSave}>Save</button>
          </div>

          <div className="info-panel">
            <p>⏱ Timer: {timer}s</p>
            <p>🔁 Reps: {repCount}</p>
            <p>🗣 Feedback: {feedback}</p>
          </div>
        </main>
      </div>
    </div>
  );
}

export default ExercisePage;
